import logo from './logo.svg';
import './App.css';
import {
    BrowserRouter,
    Routes,
    Route, Link
} from "react-router-dom";
// src/pages/index.js를 통해서 한번에 import 할 수 있도록 함

function MyView() {
    return (
        <div className="App">
            <header className="App-header">

                <Link to="/Register">

                    <a
                        className="App-link"
                        href="https://reactjs.org"
                        target="_blank"
                        rel="noopener noreferrer"
                    >
                        My View
                    </a>

                </Link>

            </header>
        </div>
    );
}

export default MyView;
